import React from 'react';
import Card from 'react-bootstrap/Card';
import Button from 'react-bootstrap/Button';

class CompletedCourses extends React.Component {
    render() {
        return(
            <div>
                {this.courseList(this.props.data)}
            </div>
        )
    }

    courseList(cartData){
        let courses = [];
        const label = this.state.liked ? 'Unlike' : 'Like'
        for(const course of cartData){
        courses.push (
            <Card style={{width: '33%', marginTop: '5px', marginBottom: '5px'}}>
                <Card.Body>
                    <Card.Title>{course.name} ({course.credits})</Card.Title>
                    <Card.Subtitle className="mb-2 text-muted">
                        {course.number}</Card.Subtitle>
                    <Card.Subtitle>{this.rateOrNot(course)}</Card.Subtitle>
                </Card.Body>
            </Card>
        )
        }
        return courses;
    }

    rateOrNot(course){
        let rateData = [];
        if(course.rating !== null){
            rateData.push(
                <Button variant="primary" onClick={()=> this.props.rateCourse(course)}>Rate this Course</Button>
            )
        }
        else{
            rateData.push(
                <div></div>
            )
        }
        return rateData;
    }
}

export default CompletedCourses;
